import React, {useContext} from 'react'
import {TableContext} from '../model/context'
const Settings= ()=> {
    const [columns, setColumns] = useContext(TableContext)
    return (
        <div>
            <form>
                {columns.map(key =>(
                <>    
                    <label for={key}></label>    
                    <input type="checkbox" value={key} name={key}/>
                </>
                ))}    
            </form>
        </div>
    )
}
export default Settings;
